import React, { useState } from 'react';
import './style.css';

const SWOT = () => {
  const [strengths, setStrengths] = useState([
    '기술적인 능력',
    '문제 해결 능력',
    '변화에 빠른 적응'
  ]);
  const [weaknesses, setWeaknesses] = useState([
    '커뮤니케이션 능력 부족',
    '시간 관리 어려움',
  ]);
  const [opportunities, setOpportunities] = useState([
    '신기술의 도입으로 성장 가능성',
    '프로젝트 경험을 통한 역량 강화',
    '창의적인 아이디어의 구현 기회'
  ]);
  const [threats, setThreats] = useState([
    '경쟁력 강한 시장',
    '기술 발전에 따른 역량 요구 증가',
    '프로젝트 일정과의 압박'
  ]);

  return (
    <div className="swot-container">
      <h1 className="swot-title" style={{color:"white"}}>웹개발 SWOT 분석</h1>
      <div className="swot-grid">
        <div className="swot-card swot-strengths">
          {/* 장점 */}
          <h2 className="swot-card-title">Strengths</h2>
          <ul className="swot-card-list">
            {strengths.map((strength, index) => (
              <li className="swot-card-item" key={index}>
                {strength}
              </li>
            ))}
          </ul>
        </div>
        <div className="swot-card swot-weaknesses">
          {/* 약점 */}
          <h2 className="swot-card-title">Weaknesses</h2>
          <ul className="swot-card-list">
            {weaknesses.map((weakness, index) => (
              <li className="swot-card-item" key={index}>
                {weakness}
              </li>
            ))}
          </ul>
        </div>
        <div className="swot-card swot-opportunities">
          {/* 기회 */}
          <h2 className="swot-card-title">Opportunities</h2>
          <ul className="swot-card-list">
            {opportunities.map((opportunity, index) => (
              <li className="swot-card-item" key={index}>
                {opportunity}
              </li>
            ))}
          </ul>
        </div>
        <div className="swot-card swot-threats">
          {/* 위협 */}
          <h2 className="swot-card-title">Threats</h2>
          <ul className="swot-card-list">
            {threats.map((threat, index) => (
              <li className="swot-card-item" key={index}>
                {threat}
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
    
  );
};

export default SWOT;
